import 'dart:convert';

import 'package:collection/collection.dart';
import 'package:flutter/material.dart';

@immutable
class ProjectStatus {
  final int? statusId;
  final String? statusName;

  const ProjectStatus({this.statusId, this.statusName});

  @override
  String toString() {
    return 'ProjectStatus(statusId: $statusId, statusName: $statusName)';
  }

  factory ProjectStatus.(
      Map<String, dynamic> data) {
    return ProjectStatus(
      statusId: data['statusId'] as int?,
      statusName: data['statusName'] as String?,
    );
  }

  Map<String, dynamic>
      () {
    return {
      'statusId': statusId,
      'statusName': statusName,
    };
  }

  /// `dart:convert`
  ///
  /// Parses the string and returns the resulting Json object as [ProjectStatus].
  factory ProjectStatus.fromJson(String data) {
    return ProjectStatus
        .(
            json.decode(data) as Map<String, dynamic>);
  }

  /// `dart:convert`
  ///
  /// Converts [ProjectStatus] to a JSON string.
  String toJson() => json.encode(
      ());

  @override
  bool operator ==(Object other) {
    if (identical(other, this)) return true;
    if (other is! ProjectStatus) return false;
    final mapEquals = const DeepCollectionEquality().equals;
    return mapEquals(
        other
            .(),
        ());
  }

  @override
  int get hashCode => statusId.hashCode ^ statusName.hashCode;
}
